import React from 'react';
import WeatherData from '../Data/WeatherData.json';

const weatherList = () => {
    return (
        <div id="weather_list">
      {WeatherData.map((weatherDetails, index)=>{
          return <div><h>weatherDetails.temperature</h></div>
      })}
        </div>
    )
};

export default weatherList;
